import { useState } from 'react';
import './App.css';
import "./Resbonsic.css"
import EditText from './Componant/Dashboard/EditText/EditText';
import HomePage from './Pages/HomePage/HomePage';
import Invits from "./Componant/Dashboard/Invits/Invits"
import {BrowserRouter as Router,Route,Routes, Link } from 'react-router-dom';
import ResetPassword from './ResetPassowrd/ResetPassowrd';
import Dashboard from './Pages/Dashboard/Dashboard';
function App() {
  const [text, setText] = useState('Initial text');

  return (
    <div className="App">
      <Routes>
      <Route path='/' element={<HomePage/>} />
      <Route path='/Dashboard' element={<Dashboard setText={setText} />} />
      <Route path='/ResetPassword' element={<ResetPassword setText={setText} />} />
      <Route path='/invite' element={<Invits  />} />
      </Routes>
    </div>
  );
}

export default App;
